  return (
    <div className="add-form">
      <p>Waht do you need for your next travel ?</p>
      <form>
        <select>
          <option value={1}>1</option>
          <option value={2}>2</option>
          <option value={3}>3</option>
          <option value={4}>4</option>
        </select>
        <input type="text" />
        <button type="submit">Add</button>
      </form>
    </div>
  );
};

export default Form;
